def optimize_route(startX, endX):
    best_route = [startX]
    next_x = ___

    while next_x < endX:
        best_cost = float("inf")
        for x in range(next_x+1, endX+1):
            cost = abs(x - next_x)
            if cost < best_cost:
                best_cost = cost
                next_x = x
        best_route.append(next_x)

    return best_route

